    false,nt"url": null,nt"notes": "From 1986 through 1989, the USGS and IOS
    (Institute of Oceanographic Sciences, U.K.) scientists conducted several surveys
    within the U.S. EEZ off Alaska. Four surveys during that time period focused on
    the Bering Sea region. As in earlier EEZ reconnaissance surveys, the USGS utilized
    the GLORIA (Geological LOng-Range Inclined Asdic) sidescan-sonar system to complete
    the geologic mapping. The collected GLORIA data were processed and digitally mosaicked
    to produce continuous imagery of the sea-floor. The results of these surveys were
    30 digital mosaics of a 2 degree by 2 degree area with a 50-meter pixel resolution.",nt"license_title":
